import React from 'react';

function ButtonContainer(event){
    function handleClick(event){
        let value = event.target.value;
        console.log(value);
    }
    return <div className='buttonContainer'>
        <button onClick={handleClick} className = "button function" >AC</button>
        <button className = "button function" >±</button>
        <button className = "button function" >%</button>
        <button className = "button operator">÷</button>
        <button className = "button">7</button>
        <button className = "button">8</button>
        <button className = "button">9</button>
        <button className = "button operator">×</button>
        <button className = "button">4</button>
        <button className = "button">5</button>
        <button className = "button">6</button>
        <button className = "button operator">-</button>
        <button className = "button">1</button>
        <button className = "button">2</button>
        <button className = "button">3</button>
        <button className = "button operator">+</button>
        <button className = "button number-0">0</button>
        <button className = "button">.</button>
        <div onClick={handleClick} className = "button operator" value = "=">=</div>
    </div>;
}

export default ButtonContainer;
